const productList = document.getElementById("productList");

function renderProducts(list) {
    productList.innerHTML = "";
    let popularIndex = 0;

    list.forEach((script, index) => {
        const color = COLORS[index % COLORS.length];

        let popularBadge = "";
        if (script.popular) {
            popularIndex++;
            popularBadge = `<div class="badge">POPULER #${popularIndex}</div>`;
        }

        productList.innerHTML += `
        <div class="card ${script.popular ? 'popular-card' : ''}" style="--accent:${color}">

            ${popularBadge}

            <div class="product">
                <!-- ICON / TITLE BESAR -->
                <div class="product-title">${script.icon}</div>

                <!-- NAMA PRODUK -->
                <h2 class="product-name">${script.name}</h2>

                <!-- SUB DESC -->
                <p class="product-desc">${script.shortDesc}</p>
            </div>

            <div class="buttons">
                <button class="buy" onclick="buyScript()">Buy</button>
                <button class="info" onclick="toggleDesc(${index})">Info</button>
                <button class="showcase" onclick="window.open('${script.youtubeUrl}','_blank')">Showcase</button>
            </div>

            <div class="description" id="desc-${index}">
                ${formatDescription(script.description)}
            </div>

        </div>
        `;
    });
}
renderProducts(scripts);
function filterScripts() {
    const keyword = document
        .getElementById("searchInput")
        .value
        .toLowerCase();

    const filtered = scripts.filter(script =>
        script.shortDesc.toLowerCase().includes(keyword) ||
        script.icon.toLowerCase().includes(keyword)
    );

    renderProducts(filtered);
}

function formatDescription(text) {
    return text
        .trim()
        .split("\n")
        .map(line => line.trim())
        .filter(line => line.length > 0)
        .map(line =>
            line.toLowerCase().includes("harga")
                ? `<strong> ${line}</strong>`
                : `• ${line}`
        )
        .join("<br>");
}

function buyScript() {
    window.open(DISCORD_BUY_LINK, "_blank");
}

function toggleDesc(index) {
    const desc = document.getElementById(`desc-${index}`);
    desc.style.display = desc.style.display === "block" ? "none" : "block";
}

